// AccumulationBehaviourType is 0 = Not Applicable (default, if not specified)
//
// 1 = BulkQuantity
// A value from a register which represents the bulk quantity of a commodity. This quantity is computed as the integral of the commodity usage rate. This value is typically used as the basis for the dial reading at the meter, and as a result, will roll over upon reaching a maximum dial value.
// Note: The roll-over behavior typically implies a roll-under behavior so that the value presented is always a positive value (e.g., unsigned integer or positive decimal).
// Note: A BulkQuantity refers primarily to the dial reading and not the consumption over a specified period of time.
//
// 3 = Cumulative
// The sum of the previous billing period values. Note: â€œCumulativeâ€ is commonly used in conjunction with â€œdemand.â€ Each demand reset causes the maximum demand value for the present billing period (since the last demand reset) to accumulate as an accumulative total of all maximum demands. So instead of â€œzeroingâ€ the demand register, a demand reset has the affect of adding the present maximum demand to this accumulating total.
//
// 4 = DeltaData
// The difference between the value at the end of the prescribed interval and the beginning of the interval. This is used for incremental interval data.
// Note: One common application would be for load profile data, another use might be to report the number of events within an interval (such as the number of equipment energizations within the specified period of time.)
//
// 6 = Indicating
// As if a needle is swung out on the meter face to a value to indicate the current value. (Note: An â€œindicatingâ€ value is typically measured over hundreds of milliseconds or greater, or may imply a â€œpusherâ€ mechanism to capture a value. Compare this to â€œinstantaneousâ€ which is measured over a shorter period of time.)
//
// 9 = Summation
// A form of accumulation which is selective with respect to time.
// Note : â€œSummationâ€ could be considered a specialization of â€œBulk Quantityâ€ according to the rules of inheritance where â€œSummationâ€ selectively accumulates pulses over a timing pattern, and â€œBulkQuantityâ€ accumulates pulses all of the time.
//
// 12 = Instantaneous
// Typically measured over the fastest period of time allowed by the definition of the metric (usually milliseconds or tens of milliseconds.) (Note: â€œInstantaneousâ€ was moved to attribute #3 in 61968-9Ed2 from attribute #1 in 61968-9Ed1.)
//
// All other values reserved.
type AccumulationBehaviourType struct {
	*UInt8
}

// ApplianceLoadReductionType is 0 - Delay Appliance Load
// Parameter requesting the appliance to respond by providing a moderate load reduction for the duration of a delay period.  Typically referring to a â€œnon-emergencyâ€ event in which appliances can continue operating if already in a load consuming period.
//
// 1 - Temporary Appliance Load Reduction
// Parameter requesting the appliance to respond by providing an aggressive load reduction for a short time period.  Typically referring to an â€œemergency/spinning reserveâ€ event in which an appliance should start shedding load if currently in a load consuming period.
//
// * Full definition of how appliances react when receiving each parameter is document in the EPA document - ENERGY STARÂ® Program Requirements, Product Specification for Residential Refrigerators and Freezers, Eligibility Criteria 5, Draft 2 Version 5.0.
//
// All other values reserved.
type ApplianceLoadReductionType struct {
	*UInt8
}

